import {HeaderDropdown as AppHeaderDropdown} from '@coreui/vue'
import httpClient from '@/utils/httpclient';
export default {
    name: "dropAccount",
    components: {
        AppHeaderDropdown
    },
    data() {
        return {
        }
    },
    mounted() {
    },
    methods: {
        logOut() {
            httpClient.post('/api/v1/logout').then(response => {
                if (response.data.code == 200) {
                    localStorage.clear();
                    this.$router.push('/login');
                }
            })
        }
    }
}
